import React from "react";
import "./styles.css";



const STYLES = ["darkblue_btn", "defaultblue_btn"];

export const Button = ({
    buttonStyle
    }) => {
    
    const checkButtonStyle = STYLES.includes(buttonStyle) ? buttonStyle : STYLES[0];



    return (
        <>
            <button
            className={`button ${checkButtonStyle}`}
            >
                
            </button>
        </>
        )
    }
